// https://leetcode.com/problems/longest-common-prefix/
class Solution {

private:
  int minimumLength;
  string lcpSoFar;

public:
  string longestCommonPrefix(vector<string>& strs) {
    if (strs.size() == 0) {
      return "";
    }
    else if (strs.size() == 1) {
      return strs[0];
    }

    minimumLength = INT32_MAX;
    for (int i = 0; i < strs.size(); i++) {
      minimumLength = std::min(minimumLength, (int)strs[i].length());
    }

    int inputSize = strs.size();
    vector<string> left(strs.begin(), strs.begin() + (inputSize/2));
    vector<string> right(strs.begin() +(inputSize/2), strs.end());
    return LCPUtil(left, right);
  }

  string findLCP(string left, string right) {
    for (int i = 0; i < minimumLength; i++) {
      if (left[i] != right[i]) {
        minimumLength = std::min(i, minimumLength);
        break;
      }
    }
    return left.substr(0, minimumLength);
  }

  string LCPUtil(vector<string> left, vector<string> right) {
    string l, r;
    if (left.size() == 1 && right.size() == 1) {
      return findLCP(left[0], right[0]);
    }
    else if (left.size() == 2 && right.size() == 1) {
      l = findLCP(left[0], left[1]);
      r = right[0];
      return findLCP(l, r);
    }
    else if (left.size() == 1 && right.size() == 2) {
      l = left[0];
      r = findLCP(right[0], right[1]);
      return findLCP(l, r);
    }

    int leftSize = left.size();
    int rightSize = right.size();
    vector<string> L1(left.begin(), left.begin() + (leftSize / 2));
    vector<string> L2(left.begin() + (leftSize / 2), left.end());

    vector<string> R1(right.begin(), right.begin() + (rightSize / 2));
    vector<string> R2(right.begin() + (rightSize / 2), right.end());

    l = LCPUtil(L1, L2);
    r = LCPUtil(R1, R2);
    return findLCP(l, r);
  }


};

